class Keypad {
    constructor(runtime) {
        /**
         * Store this for later communication with the Scratch VM runtime.
         * If this extension is running in a sandbox then `runtime` is an async proxy object.
         * @type {Runtime}
         */
        this.runtime = runtime;
    }

    /**
     * @return {object} This extension's metadata.
     */
    getInfo() {
        return {

            id: 'keypad',
            name: 'Keypad',
            colour: '#F17C67',
            colourSecondary: '#EE5E44',
            colourTertiary: '#E93516',
            blockIconURI: 'data:image/png;base64,', 

            blocks: [{
                    opcode: 'initKeypad4X3',
                    text: formatMessage({
                        id: 'keypad.initKeypad4X3',
                        default: 'Init 4x3 Keypad | R1[ROW_1] R2[ROW_2] R3[ROW_3] R4[ROW_4] C1[COLUMN_1] C2[COLUMN_2] C3[COLUMN_3]',
                        description: 'Init keypad 4X3'
                    }),
                    blockType: BlockType.COMMAND,
                    arguments: {
                        ROW_1: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        },
                        ROW_2: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        },
                        ROW_3: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        },
                        ROW_4: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        },
                        COLUMN_1: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        },
                        COLUMN_2: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        },
                        COLUMN_3: {
                            type: ArgumentType.NUMBER,
                            menu: 'digitalPin',
                            defaultValue: 0
                        }
                    }
                },
                {
                    opcode: 'initKeypad4X3I2C',
                    text: formatMessage({
                        id: 'keypad.initKeypad4X3I2C',
                        default: 'Init I2C 4x3 Keypad (PCF8574) | SDA[SDA_PIN] SCL[SCL_PIN] Addr[A0_A1_A2_STATUS]',
                        description: 'initKeypad4X3I2c'
                    }),
                    blockType: BlockType.COMMAND,
                    arguments: {
                        SDA_PIN: {
                            type: ArgumentType.NUMBER,
                            menu: 'SDAPin',
                            defaultValue: 0
                        },
                        SCL_PIN: {
                            type: ArgumentType.NUMBER,
                            menu: 'SCLPin',
                            defaultValue: 0
                        },
                        A0_A1_A2_STATUS: {
                            type: ArgumentType.NUMBER,
                            menu: 'addrSwitch',
                            defaultValue: 0
                        }
                    }
                },
                {
                    opcode: 'gotKeyValue',
                    text: formatMessage({
                        id: 'keypad.gotKeyValue',
                        default: 'Got a key value?',
                        description: 'got key value'
                    }),
                    blockType: BlockType.BOOLEAN
                },
                {
                    opcode: 'keyValue',
                    text: formatMessage({
                        id: 'keypad.keyValue',
                        default: 'Key Value',
                        description: 'key value'
                    }),
                    blockType: BlockType.REPORTER
                }
            ],

            // Optional: define extension-specific menus here.
            menus: {
                digitalPin: this._buildMenu(DIGITAL_PIN),
                SDAPin: this._buildMenu(SDA_PIN),
                SCLPin: this._buildMenu(SCL_PIN),
                addrSwitch: this._buildMenu(A0_A1_A2_STATUS)
            }


        };
    }

    get SETVALUE() {
        return [{
                text: 'low',
                value: 0
            },
            {
                text: 'high',
                value: 1
            }
        ];
    }

    /**
     * Implement myReporter.
     * @param {object} args - the block's arguments.
     * @property {string} MY_ARG - the string value of the argument.
     * @returns {string} a string which includes the block argument value.
     */
    _buildMenu(info) {
        return info.map((entry, index) => {
            const obj = {};
            obj.text = formatMessage({
                id: entry.id,
                default: entry.name
            });
            obj.name = entry.name;
            obj.value = String(index);
            return obj;
        });
    }
    initKeypad4X3(args) {
        return [args.ROW_1, args.ROW_2, args.ROW_3, args.ROW_4, args.COLUMN_1, args.COLUMN_2, args.COLUMN_3];
    }
    initKeypad4X3I2C(args) {
        return [args.SDA_PIN, args.SCL_PIN, args.A0_A1_A2_STATUS];
    }
    gotKeyValue(args) {
        return [];
    }
    keyValue(args) {
        return [];
    }
}

module.exports = Keypad;
